import { Avatar, Box, Card, CardContent, CardHeader, CardMedia, CardActions, Grid, Typography, Stack, IconButton, Chip } from "@material-ui/core";
import { red, indigo } from "@material-ui/core/colors"
import NearMeIcon from '@material-ui/icons/NearMe';
import ImageGallery from 'react-image-gallery';
import one from '../images/wallpaper.png';
import two from '../images/brain.svg';
import { Carousel } from "react-bootstrap";
import { Icon } from "@material-ui/core";

const projects =[
    {
        icon:<Avatar sx={{ bgcolor: red[500] }}>API</Avatar>,
        title:<Typography color='success.dark'>API Weather App</Typography>,
        subtitle:<Typography fontSize='0.9rem'sx={{textDecoration:'underline'}}>APIWeatherApp.feidorian.dev</Typography>,
        link: "https://apiweatherapp.feidorian.dev",
        summary: "API Weather APP is a functional live weather application built on a backend powered by the Google Places, AWS Lambda, and Open Weather API's.",
        images:[one,two]

    }
];

const ImageSlider = ({list}) => (
    <Carousel fade>
        {list.map(image => 
            <Carousel.Item style={{backgroundColor:'red', height:'14rem'}}>
            <Box component='img' width='100%' height='100%' src={image} />
        </Carousel.Item>
            )}
    </Carousel>
)

function Projects() {
    return (
        <Box overflow='auto' p={3}>
            <Grid container justifyContent='center' flexWrap='wrap'>
                {projects.map(item =>
                    <Grid item>
                        <Card sx={{ width: 345 }}>
                            <CardHeader
                                avatar={item.icon}
                                title={item.title}
                                subheader={item.subtitle}
                                action={
                                <IconButton component='a' href={item.link} target='_blank'>
                                    <NearMeIcon sx={{ color: indigo[500], fontSize: '2rem' }} />
                                    </IconButton>
                                }>

                            </CardHeader>
                            <CardMedia >
                              <ImageSlider list={item.images}/>
                            </CardMedia>
                            <CardContent>
                                <Typography variant="body2" color="text.secondary" textAlign='center'>{item.summary}
                                </Typography>
                            </CardContent>
                            <CardActions >
                                <Stack direction='row' spacing={1} flexWrap='wrap' justifyContent='center'>
                               <Chip label='React' color='primary' variant='outlined' size='small'/> 
                               <Chip label='React' color='primary' variant='outlined' size='small'/> 
                               <Chip label='React' color='primary' variant='outlined' size='small'/> 
                               <Chip label='React' color='primary' variant='outlined' size='small'/> 
                               <Chip label='React' color='primary' variant='outlined' size='small'/> 
                               <Chip label='React' color='primary' variant='outlined' size='small'/> 
                               </Stack>
                            </CardActions>
                        </Card>
                    </Grid>
                )}
            </Grid>
        </Box>
    )
};

export default Projects;
